240475","attributes":{"dimensions":"both","overlay":{"type":"object","name":"BoxAnnotation","id":"p240476","attributes":{"syncable":false,"line_color":"black","line_alpha":1.0,"line_width":2,"line_dash":[4,4],"fill_color":"lightgrey","fill_alpha":0.5,"level":"overlay","visible":false,"left":{"type":"number","value":"nan"},"right":{"type":"number","value":"nan"},"top":{"type":"number","value":"nan"},"bottom":{"type":"number","value":"nan"},"left_units":"canvas","right_units":"canvas","top_units":"canvas","bottom_units":"canvas","handles":{"type":"object","name":"BoxInteractionHandles","id":"p240482","attributes":{"all":{"type":"object","name":"AreaVisuals","id":"p240481","attributes":{"fill_color":"white","hover_fill_color":"lightgray"}}}}}}}},{"type":"object","name":"SaveTool","id":"p240483"},{"type":"object","name":"ResetTool","id":"p240484"},{"type":"object","name":"HelpTool","id":"p240485"}]}},"toolbar_location":"above","left":[{"type":"object","name":"LinearAxis","id":"p240468","attributes":{"ticker":{"type":"object","name":"BasicTicker","id":"p240469","attributes":{"mantissas":[1,2,5]}},"formatter":{"type":"object","name":"BasicTickFormatter","id":"p240470"},"axis_label":"Probability Density","major_label_policy":{"type":"object","name":"AllLabels","id":"p240471"}}},{"type":"object","name":"Legend","id":"p240495","attributes":{"location":"top_left","click_policy":"hide","items":[{"type":"object","name":"LegendItem","id":"p240496","attributes":{"label":{"type":"value","value":"Observed"},"renderers":[{"id":"p240492"}]}},{"type":"object","name":"LegendItem","id":"p240506","attributes":{"label":{"type":"value","value":"LSTM Ensemble"},"renderers":[{"id":"p240503"},{"id":"p240513"},{"id":"p240522"},{"id":"p240531"},{"id":"p240540"},{"id":"p240549"},{"id":"p240558"},{"id":"p240567"},{"id":"p240576"},{"id":"p240585"}]}},{"type":"object","name":"LegendItem","id":"p240597","attributes":{"label":{"type":"value","value":"POR Observed"},"renderers":[{"id":"p240594"}]}},{"type":"object","name":"LegendItem","id":"p240607","attributes":{"label":{"type":"value","value":"timeEnsemble"},"renderers":[{"id":"p240604"}]}},{"type":"object","name":"LegendItem","id":"p240617","attributes":{"label":{"type":"value","value":"distEnsemble"},"renderers":[{"id":"p240614"}]}},{"type":"object","name":"LegendItem","id":"p240627","attributes":{"label":{"type":"value","value":"LN_MLE"},"renderers":[{"id":"p240624"}]}},{"type":"object","name":"LegendItem","id":"p240637","attributes":{"label":{"type":"value","value":"LN_PredictedLog"},"renderers":[{"id":"p240634"}]}},{"type":"object","name":"LegendItem","id":"p240647","attributes":{"label":{"type":"value","value":"LN_PredictedMOM"},"renderers":[{"id":"p240644"}]}},{"type":"object","name":"LegendItem","id":"p240657","attributes":{"label":{"type":"value","value":"KNN_2_NN"},"renderers":[{"id":"p240654"}]}},{"type":"object","name":"LegendItem","id":"p240667","attributes":{"label":{"type":"value","value":"KNN_4_NN"},"renderers":[{"id":"p240664"}]}},{"type":"object","name":"LegendItem","id":"p240677","attributes":{"label":{"type":"value","value":"KNN_8_NN"},"renderers":[{"id":"p240674"}]}}]}}],"below":[{"type":"object","name":"LogAxis","id":"p240463","attributes":{"ticker":{"type":"object","name":"LogTicker","id":"p240464","attributes":{"num_minor_ticks":10,"mantissas":[1,5]}},"formatter":{"type":"object","name":"LogTickFormatter","id":"p240465"},"axis_label":"Unit Area Runoff (L/s/km2)","major_label_policy":{"type":"object","name":"AllLabels","id":"p240466"}}}],"center":[{"type":"object","name":"Grid","id":"p240467","attributes":{"axis":{"id":"p240463"}}},{"type":"object","name":"Grid","id":"p240472","attributes":{"dimension":1,"axis":{"id":"p240468"}}}]}}]}},{"type":"object","name":"Row","id":"p241063","attributes":{"children":[{"type":"object","name":"Div","id":"p241059","attributes":{"width":1000,"text":"\n&lt;h2&gt;Notes:&lt;/h2&gt;\n&lt;p style=\"margin-left:10px;\"&gt;\n&lt;h3&gt;Methods:&lt;/h3&gt;\n&lt;strong&gt;timeEnsemble&lt;/strong&gt;: Temporally-averaged LSTM ensemble.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;distEnsemble&lt;/strong&gt;: Distribution-averaged LSTM ensemble.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;MLE&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution fitted by maximum likelihood to observed data&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;PredictedLog&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution using predicted log-mean \\( \\mu \\) and log-standard deviation \\( \\sigma \\), i.e., parameters of \\( \\log Q \\sim \\mathcal{N}(\\mu, \\sigma^2) \\).&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;PredictedMOM&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution using predicted mean and standard deviation of \\( Q \\), with parameters estimated by method of moments.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KNN&lt;/strong&gt;: Attribute-based ensemble estimate using average distribution from the 2 and 8 nearest neighbors (2/8-NN) selected by similarity in catchment attributes.&lt;br&gt;&lt;br&gt;\n&lt;h3&gt;Performance Measures&lt;/h3&gt;\n&lt;strong&gt;RMSE&lt;/strong&gt;: Root Mean Square Error, \\( \\sqrt{ \\frac{1}{N} \\sum_{t=1}^{N} \\left( Q_{\\text{sim}}(t) - Q_{\\text{obs}}(t) \\right)^2 } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;VE&lt;/strong&gt;: Volume Efficiency, \\( 1 - \\frac{ \\left| \\sum Q_{\\text{sim}} - \\sum Q_{\\text{obs}} \\right| }{ \\sum Q_{\\text{obs}} } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;PMF/FDC&lt;sub&gt;Volume Bias&lt;/sub&gt;&lt;/strong&gt;: Relative bias in expected flow from estimated PMFs/FDCs, \\( \\frac{ \\mathbb{E}[Q_{\\text{sim}}] - \\mathbb{E}[Q_{\\text{obs}}] }{ \\mathbb{E}[Q_{\\text{obs}}] } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;RE&lt;/strong&gt;: Relative error, computed as \\( \\frac{F_{\\text{sim}}(p) - F_{\\text{obs}}(p)}{F_{\\text{obs}}(p)} \\), where \\( F(p) \\) denotes the duration curve (FDC) for exceedance duration \\(p\\).&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;NSE&lt;/strong&gt;: Nash\u2013Sutcliffe Efficiency, defined as \\( 1 - \\frac{\\sum (Q_{\\text{sim}} - Q_{\\text{obs}})^2}{\\sum (Q_{\\text{obs}} - \\bar{Q}_{\\text{obs}})^2} \\). Values closer to 1 indicate better performance.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KGE&lt;/strong&gt;: Kling\u2013Gupta Efficiency, combining correlation, variability, and bias:&lt;br&gt;\n\\( \\quad \\mathrm{KGE} = 1 -\\ \\sqrt{(r - 1)^2 + (\\alpha - 1)^2 + (\\beta - 1)^2} \\)&lt;br&gt;\n\\(\\quad\\)&lt;strong&gt;r&lt;/strong&gt;: Pearson correlation; &lt;strong&gt;\u03b1&lt;/strong&gt;: ratio of standard deviations \\( \\left( \\frac{\\sigma_{\\text{sim}}}{\\sigma_{\\text{obs}}} \\right) \\); &lt;strong&gt;\u03b2&lt;/strong&gt;: bias ratio \\( \\left( \\frac{\\mu_{\\text{sim}}}{\\mu_{\\text{obs}}} \\right) \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KLD&lt;/strong&gt;: Kullback\u2013Leibler divergence between observed and simulated distributions:&lt;br&gt;\n\\( \\quad D_{\\mathrm{KL}}(P \\parallel Q) = \\sum P(x) \\log \\left(\\frac{P(x)}{Q(x)}\\right) \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;EMD&lt;/strong&gt;: Sum of absolute differences between cumulative distributions: \\( \\mathrm{EMD}(P, Q) = \\sum_x \\left| \\mathrm{CDF}_P(x) - \\mathrm{CDF}_Q(x) \\right| \\)\n&lt;/p&gt;\n"}}]}}]}}]}}
